import { useEffect, useState } from 'react';
import * as S from '../../styles/Exercise/Exercise.style'


function ExerciseDisplay({ type, part, name, numbers, sets, duration, calories }) {
  const [count, setCount] = useState(0)
  useEffect(() => {
    setCount({duration})
  }, [])
  const [amount, setAmount] = useState(0)
  useEffect(() => {
    setAmount({numbers})
  }, [])
  return (
    <>
      <S.Exercise>{type}/{part}</S.Exercise>
      <S.Exercise>{name}</S.Exercise>
      <S.Exercise>{count.duration}</S.Exercise>
      <S.Exercise>{amount.numbers}</S.Exercise>

    </>

  )
}

export default ExerciseDisplay;
